import React from "react";
import campo from "./campo.css";

function Campo({players}){
    const divs = Array(players).fill().map((_, i) => <div key={i} className="campo-div" />);
    return(
        <div className="campo">
            {divs}
        </div>
    );
}
export {Campo};
